class Task extends Component {

    constructor(props){
        super(props);
        this.state ={
            status: ['column1','column2']
        }
    }
    render() {
        return (
                <li className="list-group-item">
                    <p>Content: {this.props.content}</p>

                    <button type="button" className="btn btn-primary">
                        click
                    </button>

                </li>
        );
    }

}

export default Task;
